<script id="vertex-shader" type="x-shader/x-vertex">

attribute  vec3 vPosition;
attribute  vec4 vColor;
attribute  vec3 vNormal;
varying vec4 fColor;

uniform mat4 p;
uniform mat4 v;
uniform mat4 m;


uniform float floorF ;
float pos = 1.0;
vec3 lightPos = vec3(1.5, 1.5 , 1.5);



void main() 
{		
	vec4 tColor = vec4(1.00,0.85,0.55, 1.0 );	
	
	vec4 temp = p * v * m * vec4(vPosition , 1.0 );
	vec3 lightPosE = vec3(v * m *  vec4(vPosition , 1.0 ));
	vec3 lightDir = (lightPos - lightPosE);
	//float lightDist =  length(lightDir);
	lightDir = normalize(lightDir);
	//lightDir = lightPosE;
	vec3 wNormal = normalize ( mat3(v * m ) * vNormal);
	float kd = max(dot(wNormal , lightDir) , 0.0);
	
	/*
	float a = .1;
	float b = .2;
	float c = .01;
	float d = a + (b * lightDist) + (c * lightDist * lightDist);
	*/
	//d = lightDist * lightDist;
	fColor = vec4( vec3(tColor * kd) , 1);
		
	
	
	if(vPosition[1] < -0.269425 ){

	if(floorF == 2.0){
	// float f = mod( floor(5.0*(temp.z - floor(temp.z))) + floor(5.0*(temp.x - floor(temp.x))), 2.0);
     //vec3 col = 0.4 + 0.1*f*vec3(1.0);
	fColor = vec4(kd * vec3(0.4, 0.4,  0.4),  1.0);
			//vec4(col , 1);
	}else
	fColor =vec4(kd*vec3( .35 , .25,  0.25),  1.0);;
	}
	
    gl_Position = temp;
} 
</script>

<script id="vertex-shader_2" type="x-shader/x-vertex">

}
